import css from "./style.module.css";
import { Link } from "react-router-dom";
import { type } from "os";

interface MenuType {
  categories: {
    id: number;
    type: string;
    label: string;
  }[];
}
export const Menu = (props: MenuType) => {
  return (
   <div>
     <Menu mode = "vertical">
      {props.categories.map((item) => (

            <Link to={`/${type}`}> {item.label} </Link>

      ))}
         </Menu> 
</div>
  );
};
